import styled from 'styled-components';
import { useState } from 'react';
import { PageWrapper } from '../../components/shared/CommonStyles';

export default function Login() {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');

  return (
    <PageWrapper>
      <LoginWrapper>
        <PageTitle>
          Bem vindo! Realize seu Login ou Cadastre novo Posto de Vacinação
        </PageTitle>

        <FormContainer onSubmit={checkCredentials}>
          <label for="email">E-mail: </label>
          <input
            type="email"
            id="email"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
            required
          />

          <label for="password">Senha: </label>
          <input
            type="password"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
            required
          />

          <LoginTypesContainer>
            <label for="login-secretaria"> Secretaria de Saúde </label>
            <input
              type="radio"
              name="login-type"
              id="login-secretaria"
              value="secretaria-de-saude"
            ></input>

            <label for="login-posto-vacinacao"> Posto de Vacinação </label>
            <input
              type="radio"
              name="login-type"
              id="login-posto-vacinacao"
              value="secretaria-de-saude"
              checked="checked"
            ></input>
          </LoginTypesContainer>
        </FormContainer>
      </LoginWrapper>
    </PageWrapper>
  );
}

const LoginWrapper = styled.div`
  background-color: white;
  border-radius: 20px;
  width: 800px;
`;
